import CryptoJS from 'crypto-js';

const encrypt = (str, key) => {
  const encrypted = CryptoJS.AES.encrypt(str, key).toString();
  return encrypted;
}

const decrypt = (encryptedStr, key) => {
    try {
      const decryptedBytes = CryptoJS.AES.decrypt(encryptedStr, key);
      if (decryptedBytes) {
        const decryptedText = decryptedBytes.toString(CryptoJS.enc.Utf8);
        return decryptedText || ''; // Devuelve un string vacío si decryptedText es nulo o vacío
      } else {
        return ''; // Devuelve un string vacío si la desencriptación falla
      }
    } catch (error) {
      return ''; // Devuelve un string vacío si la desencriptación falla debido a un error
    }
}
  
module.exports = {
    encrypt,
    decrypt,
};
